import React, { Component } from "react";

import TableFilters, {
  InputDescriptor,
} from "../../components/QueryView/TableFilters/TableFilters";
type Props = {};

const Services: React.FC<Props> = ({}) => {
  const elements = [
    { type: "text", value: "", placeholder: "", min: "", max: "" },
  ];

  let x: InputDescriptor = {
    type: "text",
    value: "",
    placeholder: "",
    min: "",
    max: "",
  };
  return (
    <>
      <div className="container-fluid">
        <h1>
          Consulta <small>Facturas</small>
        </h1>
        <div className="row">
          <TableFilters elements={elements} />
          <div className="col-10">
            <div className="container-fluid">
              <div className="table-responsive">
                <CustomTable />
              </div>
            </div>

            <div className="container">
              <center>
                <TablePaginator />
              </center>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Services;
